// src/parties_communes/Project.js
import React from "react";
import "./Work.css"; // ou Work.css si le style est partagé

function Project({ image, title, techs, description, technologies, skills, github, site }) {
  return (
    <div className="projet">
      <div className="projet-header">
        <img src={image} alt={title} loading="lazy" />
        <h3>{title}</h3>
        <div className="technos">{techs}</div>
        <span className="arrow">&#9662;</span>
      </div>

      <div className="projet-details">
        <p>
          <strong>Description :</strong>
          <br />
          {description}
        </p>
        <p>
          <strong>Technologies utilisées :</strong>
          <br />
          {technologies}
        </p>
        <p>
          <strong>Compétences mises en pratique :</strong>
          <br />
          {skills}
        </p>
        {github && (
          <a href={github} target="_blank" rel="noopener noreferrer" className="btn-projet">
            Voir le projet
          </a>
        )}
        {site && (
          <a href={site} target="_blank" rel="noopener noreferrer" className="btn-projet">
            Voir le site
          </a>
        )}
      </div>
    </div>
  );
}

export default Project;
